sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var inputs = SapRFCUtil.EscapeHTMLInjection(inputs);
        var inputs = SapRFCUtil.trimInputs(inputs);

        inputs.services = SapRFCUtil.filterArrayObjects(inputs.services);

        var mandatoryFieldsList = {
            "Header Data of Entry Sheet > Package Number": inputs.header.PCKG_NO,
            "Header Data of Entry Sheet > Short Text of Service Entry Sheet": inputs.header.SHORT_TEXT,
            "Header Data of Entry Sheet > Purchasing Document Number": inputs.header.PO_NUMBER,
            "Header Data of Entry Sheet > Item Number of Purchasing Document": inputs.header.PO_ITEM,
            "Header Data of Entry Sheet > Document Date in Purchasing Document": inputs.header.DOC_DATE,
            "Header Data of Entry Sheet > Posting Date in Purchasing Document": inputs.header.POST_DATE,
            "Header Data of Entry Sheet > Acceptance Indicator": inputs.header.ACCEPTANCE,
        };

        if (inputs.services.length != 0) {
            var itemdataArr = inputs.services;
            for (var index = 0; index < itemdataArr.length; ++index) {
                var itemdataNum = index + 1;
                var itemdataElement = 'Services [' + itemdataNum + ']';
                mandatoryFieldsList[itemdataElement + " > Package Number"] = itemdataArr[index].PCKG_NO;
                mandatoryFieldsList[itemdataElement + " > Internal Line Number"] = itemdataArr[index].LINE_NO;
            }
        }

        var emptyFields = SapRFCUtil.checkMandatoryFields(mandatoryFieldsList);
        if (JSUtil.notNil(emptyFields)) {
            throw 'Mandatory field(s) '.concat(emptyFields) + ' cannot be blank.';
        }

        var info = SapRFCUtil.getConnectionFromAlias(inputs.alias_id);
        outputs.conn_host = info.getAttribute("host");
        outputs.conn_params = info.getExtendedAttributes();

        var connId = info.getAttribute("sys_id");
        outputs.cred_id = SapRFCUtil.getCredentialIdFromConnection(connId);

        var payload = SapRFCUtil.unflattenPayload(inputs.additional_in);
        payload['IV_ENTRYSHEETHEADER'] = inputs.header;

        if (inputs.services.length != 0) {

            payload['IT_ENTRYSHEETSERVICES'] = inputs.services;
        }

        outputs.payload = SapRFCUtil.removeMetaNameField(payload);
    } catch (e) {
        throw e;
    }
})(inputs, outputs);

